import './card.components.css';
export const Card = (props) => (
    <div className="card-container">
        <img src={`https://robohash.org/${props.monster.id}?set=set2`} height="300" width="300" alt="monster"/>
        <h1>{props.monster.name} </h1>
        <h1>{props.monster.email} </h1>
    </div>
);
